function b64ToBytes(b){const s=atob(b);const u=new Uint8Array(s.length);for(let i=0;i<s.length;i++)u[i]=s.charCodeAt(i);return u;}
function boot(){document.getElementById('splash').style.display='none';document.getElementById('app').style.display='flex';loadEmulator();}
function setProgress(p,m){document.getElementById('lbar').style.width=p+'%';document.getElementById('lmsg').textContent=m;}
function showError(m){const e=document.getElementById('lerr');e.textContent=m;e.style.display='block';setProgress(100,'ERROR');}

function ejsStart(e) {
  e.preventDefault(); e.stopPropagation();
  // Flash visual feedback
  const btn=document.getElementById('startBtn');
  btn.style.background='#ffaa00'; btn.style.color='#000';
  setTimeout(()=>{btn.style.background='#ffaa00';},180);

  // Method 1: gameManager direct (most reliable)
  try{ EJS_emulator.gameManager.buttonDown(0,3); setTimeout(()=>EJS_emulator.gameManager.buttonUp(0,3),150); return; }catch(e1){}
  // Method 2: module FS / input
  try{ EJS_emulator.gameManager.simulateInput(0,3,1); setTimeout(()=>EJS_emulator.gameManager.simulateInput(0,3,0),150); return; }catch(e2){}
  // Method 3: Enter key on canvas
  try{
    const cv=document.querySelector('#game canvas');
    if(cv){cv.setAttribute('tabindex','0');cv.focus();}
    document.dispatchEvent(new KeyboardEvent('keydown',{key:'Enter',keyCode:13,bubbles:true}));
    setTimeout(()=>document.dispatchEvent(new KeyboardEvent('keyup',{key:'Enter',keyCode:13,bubbles:true})),150);
  }catch(e3){}
}

function loadEmulator(){
  setProgress(10,'DECODIFICANDO ROM...');
  let rb;
  try{rb=b64ToBytes(ROM_B64);setProgress(30,'ROM OK â€” '+(rb.length/1024).toFixed(0)+'KB');}
  catch(e){showError('Error: '+e.message);return;}
  const url=URL.createObjectURL(new Blob([rb],{type:'application/octet-stream'}));
  setProgress(40,'CARGANDO EMULADOR...');
  window.EJS_player='#game';
  window.EJS_core='genesis_plus_gx';
  window.EJS_gameUrl=url;
  window.EJS_gameName='ALADDIN';
  window.EJS_color='#ffaa00';
  window.EJS_backgroundColor='#000000';
  window.EJS_startOnLoaded=true;
  window.EJS_pathtodata='https://cdn.emulatorjs.org/stable/data/';
  window.EJS_VirtualGamepad=true;
  window.EJS_Buttons={gamepad:true,mute:true,settings:true,fullscreen:false,save:true,load:true,volume:true,quickSave:true,quickLoad:true,reset:true};
  window.EJS_defaultOptions={'save-state-slot':1,'video-smooth':false};
  // Genesis RetroPad: B=0,Y=1,Select=2,Start=3,Up=4,Down=5,Left=6,Right=7,A=8,X=9
  window.EJS_onLoadProgress=p=>setProgress(40+p*55,'CARGANDO CORE... '+Math.round(p*100)+'%');
  window.EJS_onGameStart=()=>{
    setProgress(100,'ðŸª” GOTTA GO FAST!');
    setTimeout(()=>{
      document.getElementById('loader').style.display='none';
      // Focus canvas so keyboard events work
      const cv=document.querySelector('#game canvas');
      if(cv){cv.setAttribute('tabindex','0');cv.focus();}
    },600);
  };
  const s=document.createElement('script');s.src='https://cdn.emulatorjs.org/stable/data/loader.js';
  s.onerror=()=>{const s2=document.createElement('script');s2.src='https://cdn.jsdelivr.net/npm/emulatorjs@latest/data/loader.js';document.head.appendChild(s2);};
  document.head.appendChild(s);
  let f=40;const iv=setInterval(()=>{if(document.getElementById('loader').style.display==='none'){clearInterval(iv);return;}f=Math.min(f+1,94);if(f<94)setProgress(f,'CARGANDO...');},300);
}
